// src/App.js
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { AuthProvider, useAuth } from "./components/context/AuthContext";

// --- Admin Pages ---
import AdminLogin from "./pages/admin/AdminLogin";
import AdminDashboard from "./pages/admin/AdminDashboard";
import AdminReports from "./pages/admin/AdminReports";
import AdminBlockUser from "./pages/admin/AdminBlockUser";


// --- Verification Pages ---
import VerifyDoctor from "./pages/verify/VerifyDoctor";
import VerifyAadhaar from "./pages/verify/VerifyAadhaar";

// --- Report Page ---
import ReportUser from "./pages/reports/ReportUser";

// --- Layout + Guards ---
import MainLayout from "./components/MainLayout";
import ProtectedRoute from "./components/ProtectedRoute";
import PrivateAdmin from "./components/PrivateAdmin";

// --- Public pages ---
import Welcome from "./components/Welcome";
import Login from "./components/Login";
import Register from "./components/Register";

// --- Core Protected Pages ---
import DashboardWrapper from "./components/DashboardWrapper";
import ProfilePage from "./pages/ProfilePage";
import SettingsPage from "./pages/SettingsPage";

// --- Patient Pages ---
import PatientRequestsPage from "./pages/PatientRequestsPage";
import CloudRecordsPage from "./pages/CloudRecordsPage";

// --- Doctor Pages ---
import DoctorRequestAccessPage from "./pages/DoctorRequestAccessPage";
import DoctorSentRequestsPage from "./pages/DoctorSentRequestsPage";
import DoctorUploadPage from "./pages/DoctorUploadPage";
import DoctorViewRecordsPage from "./pages/DoctorViewRecordsPage";

// --- CSS ---
import "./App.css";
import "./index.css";

function App() {
  const { auth } = useAuth();

  const publicRouteWrapper = (page) => (
    <div className="centered-page-wrapper">{page}</div>
  );

  return (
    <BrowserRouter>
      <Routes>
        {/* ----------------------------- */}
        {/*       PUBLIC ROUTES          */}
        {/* ----------------------------- */}
        <Route path="/" element={publicRouteWrapper(<Welcome />)} />
        <Route path="/login" element={publicRouteWrapper(<Login />)} />
        <Route path="/register" element={publicRouteWrapper(<Register />)} />
        <Route
  path="/admin/login"
  element={publicRouteWrapper(<AdminLogin />)}
/>


        {/* Report User (allowed only after login) */}
        <Route
          path="/report"
          element={
            <ProtectedRoute>
              <MainLayout>
                <ReportUser />
              </MainLayout>
            </ProtectedRoute>
          }
        />

        {/* -------------------------------- */}
        {/*   ADMIN PUBLIC + PROTECTED       */}
        {/* -------------------------------- */}
        <Route path="/admin/login" element={publicRouteWrapper(<AdminLogin />)} />

        <Route
          path="/admin/dashboard"
          element={
            <PrivateAdmin>
              <AdminDashboard />
            </PrivateAdmin>
          }
        />
        <Route
  path="/admin/reports"
  element={
    <PrivateAdmin>
      <AdminReports />
    </PrivateAdmin>
  }
/>

<Route
  path="/admin/block-user"
  element={
    <PrivateAdmin>
      <AdminBlockUser />
    </PrivateAdmin>
  }
/>
        <Route
  path="/admin/users"
  element={
    <PrivateAdmin>
      <AdminUsers />
    </PrivateAdmin>
  }
/>


        {/* ----------------------------- */}
        {/*    PATIENT / DOCTOR ROUTES    */}
        {/* ----------------------------- */}
        <Route element={<ProtectedRoute />}>
          <Route element={<MainLayout />}>
            {/* Core Routes */}
            <Route path="/dashboard" element={<DashboardWrapper />} />
            <Route path="/profile" element={<ProfilePage />} />
            <Route path="/settings" element={<SettingsPage />} />

            {/* ---------- Patient Routes ---------- */}
            {auth?.role === "patient" && (
              <>
                <Route
                  path="/cloud-records"
                  element={<CloudRecordsPage />}
                />
                <Route path="/my-requests" element={<PatientRequestsPage />} />
                <Route
                  path="/verify-aadhaar"
                  element={<VerifyAadhaar />}
                />
              </>
            )}

            {/* ---------- Doctor Routes ---------- */}
            {auth?.role === "doctor" && (
              <>
                <Route
                  path="/request-access"
                  element={<DoctorRequestAccessPage />}
                />
                <Route
                  path="/sent-requests"
                  element={<DoctorSentRequestsPage />}
                />
                <Route
                  path="/upload-record"
                  element={<DoctorUploadPage />}
                />
                <Route
                  path="/view-records"
                  element={<DoctorViewRecordsPage />}
                />
                <Route
                  path="/verify-doctor"
                  element={<VerifyDoctor />}
                />
              </>
            )}
          </Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

const AppWrapper = () => (
  <AuthProvider>
    <App />
  </AuthProvider>
);

export default AppWrapper;
